import React, { Component} from 'react';
import { BrowserRouter as Router, Route, Link } from  "react-router-dom";
import { white } from 'material-ui/styles/colors';
import { black } from 'material-ui/styles/colors';
import { blue100 } from 'material-ui/styles/colors';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import { green100 } from 'material-ui/styles/colors';
import { green500 } from 'material-ui/styles/colors';
import BookingHistoryDetails from './bookingHistoryDetails'

const bookingHistoryDetails = [
    {
        bookingID : "1"
        ,path : "/history/1"
        ,exact : true
        ,bookingDate : "Apr 01 2019"
        ,pickupLocation : "DLF"
        ,dropLocation : "Guindy"
        ,deliveryCharge : "1000.00"
        ,typeOfVehicle : "Auto"
        ,productType : "ELECTRONIC ITEMS"
        ,main : () => <h2>History Details of Apr 01 2019</h2>
    },
    {
        bookingID : "2"
        ,path : "/history/2"
        ,bookingDate : "Mar 01 2019"
        ,pickupLocation : "Ramapuram"
        ,dropLocation : "Pallavaram"
        ,deliveryCharge : "100.00"
        ,typeOfVehicle : "Two Wheeler"
        ,productType : "Fruits"
        ,main : () => <h2>History Details of Mar 01 2019</h2>
    },
    {
        bookingID : "3"
        ,path : "/history/3"
        ,bookingDate : "Feb 01 2019"
        ,pickupLocation : "Meenampakkam"
        ,dropLocation : "Tambaram"
        ,deliveryCharge : "1000.00"
        ,typeOfVehicle : "Auto"
        ,productType : "ELECTRONIC ITEMS"
        ,main : () => <h2>History Details of Feb 01 2019</h2>
        

    },
    {
        bookingID : "4"
        ,path : "/history/4"
        ,bookingDate : "Jan 01 2019"
        ,pickupLocation : "Airport"
        ,dropLocation : "Guindy"
        ,deliveryCharge : "1000.00"
        ,typeOfVehicle : "Auto"
        ,productType : "ELECTRONIC ITEMS"
        ,main : () => <h2>History Details of Jan 01 2019</h2>
    }
];


const styles = {
    card: {
      minWidth: 275,
    },
    bullet: {
      display: 'inline-block',
      margin: '0 2px',
      transform: 'scale(0.8)',
    },
    title: {
      fontSize: 14,
    },
    pos: {
      marginBottom: 12,
    },
  };
class BookingHistory extends Component{
    handleClick = (anything)=>{
        console.log(anything)
    }
    render(){
        const { classes } = this.props;
        return(
            <Router>
            <div style = {{display : "flex"}}>
            <div style = {{ padding : "10px", width : "30%", height : "100%", background : green500, color: white}}>
            <h1>Booking History</h1>
            {bookingHistoryDetails.map((anything, index)=>(
                <Card className={classes.card}>
                <CardContent>
                    <Typography component="p">
                    {'Booking Date : '} {anything.bookingDate}
                    </Typography>

                    <Typography className={classes.title} color="textSecondary" gutterBottom>
                    Pickup Location : {anything.pickupLocation}</Typography>

                    <Typography className={classes.title} color="textSecondary" gutterBottom>
                    Drop Location : {anything.dropLocation}</Typography>

                    <Typography className={classes.pos} color="textSecondary"> Delivery Charge : {anything.deliveryCharge}</Typography>
                   
                    <Link to = {anything.path}>More Details</Link>
                </CardContent>
                </Card>
            ))}
            
            </div>

            <div style = {{ flex: 100, padding : "10px"}}>
            {bookingHistoryDetails.map((anything, index)=>(
                <Route 
                key = {index}
                path = {anything.path}
                render= {props=><BookingHistoryDetails bookingDetails={anything}/>}
                />
            ))}   
            </div>
            </div>
        </Router>
        )
    }
}
BookingHistory.propTypes = {
    classes: PropTypes.object.isRequired,
  };

export default withStyles(styles)(BookingHistory);
